import React, { useEffect } from 'react';
import { Routes, Route } from 'react-router-dom';
import Home from './Home';

function Bookkeep() {
  useEffect(() => {
    document.title = Bookkeep
  },[])

  return (
    <Routes>
      <Route to="test" element={<Home />}></Route>
      <Route to="/bookkeep/test" element={<Home />}></Route>
      <Route to="/bookkeep/*" element={<Home />}></Route>
    </Routes>
    // <div>123</div>
  );
}

export default Bookkeep;
